import React , { useState , useEffect } from "react";
import { Link, NavLink } from "react-router-dom";
import { sortable } from 'react-sortable';
import SortableComponent from '../SortableProductCategory/productCategory'
import axios from 'axios';

function ComponentHeader() {

  const [data, setData] = useState({ hits: [] });


  useEffect(async () => {
    const result = await axios(
      'http://localhost:5000/product-category',
    );
 
    setData(result.data);
    console.log(data)
  });

  return (

    <React.Fragment>
      <div className="header__navigation">
        <input type="text" placeholder="search" />
      </div>
      <div className="header__navigation">
        <ul>
          <li>
            <NavLink activeClassName="active" to="/">
              Home
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/about">
              About
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/clients">
              client
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/user-login">
              Login
            </NavLink>
          </li>

          <li>
            <NavLink activeClassName="active" to="/user-register">
              Registration
            </NavLink>
          </li>
        </ul>
      </div>
 

      <SortableComponent />
    </React.Fragment>
  );
}

export default ComponentHeader;
